import Routes from './routes/Routes'
import './App.css';
import { Button } from 'react-bootstrap'
import { Link } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <h1>The Phone Cave</h1>
      <Link to='/telefonos'><Button>See our phones</Button></Link>
      <Routes />
    </div>
  );
}

export default App;
